import React from "react";
// import CardBtn from "../CardBtn";
import "./style.css";

function Card (object) {
    return(
        <div class="card">
            <img src={object.image} class={object.test}>
            </img>
            <div class="card-body">
                <h5 class="card-title">Title</h5>
                <p>Test Information + the phrase "{object.test}"</p>
            </div>
        </div>
    )
}

export default Card;
